全品！送料無料キャンペーン実施中！<br>(※一部地域除く詳しくはご利用ガイドをご覧ください)超小型で便利なレバーホイスト【ガッチャ】<br>粘り強さのある焼入れチェーンに握り易いグリップ、フッククラッチ付きフックはワイヤーロープ・シャックル・ベルトスリングとの作業・効率性をアップしてくれます。<br>便利に安全に荷締め(レバーホイスト・ガッチャ)作業ができます。<br><br>能力に応じた4タイプのラインナップになります。<br><br>【仕様】<br><br>・最大能力：1.0t<br>・上下フック間：最小320mm<br>・ハンドル長さ：280mm<br>・揚程：1.5m<br>・重量：6.7kg<br>・A：28mm<br>・本体材質：スチール<br><br>レバーホイスト(ガッチャ)の使用用途<br>重量物の緊縛輸送、鉄骨の歪み取り、大型機械や荷物などの引き寄せ、建築物の芯だし、自動車の鈑金塗装のフレーム修正、山林業や果樹園での原木搬出・抜根・杭抜作業、景石・柱石・ヒューム管などの据付作業、運輸・橋梁・建設・土木・造船・林業などの荷揚げ・揚重・現場作業など幅広い業種で使用されています。<br><br>商品注意事項<br>(1)手動力は、定格巻上げ時、作業者の手動力に負担を掛け過ぎない適切な値としています。<br>(2)作動荷重は、ＪＩＳ規格 B8819に規定されている「作動試験の作動荷重」であり、実際の作業で負担できる荷重ではありません。<br>(3)実作業は定格荷重内で余裕をもって行ってください。<br>(4)作業前、変形や傷はないか動きはスムーズか確認し、点検で問題のある製品は使用してはいけません。<br>(5)切り替えツマミの位置は、作業方向と一致しているか常に確認しながら作業を行ってください。<br>(6)巻き上下の作業中は、ユーテンニギリに触れてはいけません。<br>(7)巻き下げ操作でロードチェーンが戻らない場合は、荷重がかかり過ぎている事が考えられます。切り替えツマミを“Ｄ”に切り替え反時計回りに力いっぱい回すと解除できます。取り外し後は十分な点検と定格荷重を確認してください。<br>(8)メカニカルブレーキのブレーキパンには油を付けないでください。<br>(9)雨が直接かかるなど、錆の元になるような場所で保管しないでください。<br>(10)注意事項を守らず、誤った使用上の事故や損害について、当社は一切の責任を負いません。<img src="http://image.rakuten.co.jp/suncardo/cabinet/sign-banner/700x150-20.jpg" border="0">
