・超極細電石不織布を使用したフィルターはミクロのホコリでも吸い寄せられるようにフィルターに付着させます。<br>
・超極細電石不織布は約2μｍと細く、この繊維の１本１本に電石(静電気)をもたせていますので、どんな粉じんでも瞬間に捕えます。<br>
・このマスクに内蔵しているフィルターはジャバラ式(広げれば６倍)だから呼吸が楽にでき、粉じんを瞬間に強力キャッチし、使用時間も長持ちします。<br>
・労働安全衛生関係法令に基づき、防じんマスクの使用が規定されている作業場所では、国家検定に合格した防じんマスク(型式検定合格標章が貼付されています。)を騎亜ならずご使用ください。<br><br>
